            <TableData name="Active VPN" data={data.active_vpn} />
            <TableData name="Bot Status" data={data.bot_status} />
            <TableData name="City" data={data.city} />
            <TableData name="Country Code" data={data.country_code} />
          </tbody>
        </table> */}
      </div>
    </div>
  );
}

export default DisplayIpData;
